import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import Modal from '@mui/material/Modal'
import Box from '@mui/material/Box'
import Typography from '@mui/material/Typography'
import Button from '@mui/material/Button'
import useStyles from './styles';
import Checkbox from '@mui/material/Checkbox'


const ModalComponent = ({isOpen,handleClose}) => {
  const classes = useStyles();

  const [isChecked, setIsChecked] = useState(false);

  return (
    <Modal
  open={true}
  aria-labelledby="modal-modal-title"
  aria-describedby="modal-modal-description"
>
  <Box className={classes.modal}>
    <h1 className={classes.heading}>Вам точно есть 18 ?</h1>
    <Checkbox label='yes' checked={isChecked} onClick={(e) => setIsChecked(e.target.checked)}/>
    <h1>Я принимаю Пользовательское соглашение</h1>
  </Box>
</Modal>
  )
}

export default ModalComponent;
